"156746":{"id":"156746","name":"Pretzel e os filhotes","slug":"pretzel-e-os-filhotes","original_title":"Pretzel and the Puppies","overview":"Conheça Pretzel, o dachshund mais longo do mundo, um pai brincalhão e acolhedor para cinco cachorrinhos. Junto com sua esposa, Greta, eles encorajam seus filhotes a levantar suas patas para resolver problemas e \"deixar sua marca\" no mundo.","first_air_date":"2022-02-11","episode_run_time":12,"vote_average":8,"number_of_seasons":2,"number_of_episodes":18,"created_by":["Steven Altiere","Kim Howitt"],"production_companies":["Saturday Animation Studio","House of Cool Studios","HarperCollins Publishers"],"genres":["Kids","Animação"],"certification":"L","backdrop_path":"https://image.tmdb.org/t/p/original/ktJED96lvwkcKARgWM1dhxRJVw7.jpg","poster_path":"https://image.tmdb.org/t/p/original/frEXlNxQVrKxPhdqoo0ObeaOFLC.jpg","cast":["Mark Duplass","Nasim Pedrad","Alex Jayne Go","Amari McCoy","Gracen Newton"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/frEXlNxQVrKxPhdqoo0ObeaOFLC.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/frEXlNxQVrKxPhdqoo0ObeaOFLC.jpg","air_date":"2022-02-11","episode_count":9,"overview":"N/A","vote_average":10,"episodes":{"1":{"name":"Deixe sua marca / Filhotes para a corrida","overview":"Paxton deixa sua marca pintando um mural colorido da cidade. Pedro ajuda os filhotes menores a competir na corrida de carrinhos.","air_date":"2022-02-11","runtime":23,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":10},"2":{"name":"Um mimo / Filhotes em desfile","overview":"Pedro se inspira para ajudar o Puck a experimentar coisas novas. Poppy encontra a maneira perfeita de celebrar o aniversário de Muttgomery.","air_date":"2022-02-11","runtime":23,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":10},"3":{"name":"Faça o Doxy / Cachorros quentes","overview":"Pippa salva o dia em que a aula de exercícios favorita de Nana Doxie é cancelada. Puck inventa uma maneira legal de lidar com um dia quente.","air_date":"2022-02-11","runtime":23,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":10},"4":{"name":"A nossa tigela / Pode sim","overview":"Pippa prepara uma refeição especial que os amigos com alergias alimentares podem desfrutar. O pensamento imaginativo de Poppy transforma o cone de Dalila em um divisor de águas.","air_date":"2022-02-11","runtime":23,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":10},"5":{"name":"Boas-vindas /Jogos de tosa","overview":"O novo vizinho, Gus, continua se perdendo, então Poppy oferece ajudar. Pedro encontra uma maneira de fazer Dill ficar parado para seu corte no Palácio de tosa de Gigi.","air_date":"2022-02-11","runtime":23,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":10},"6":{"name":"O show deve latir /Cães ao trabalho","overview":"Pippa cria instrumentos para a banda depois que os deles acidentalmente quebram. Poppy garante que cães de todos os tamanhos possam acessar a nova torre de visão.","air_date":"2022-02-11","runtime":23,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":10},"7":{"name":"Cachorro em rodas / Fareje e compartilhe","overview":"Pedro ajuda a criar uma zona livre de tráfego para patinetes. Os filhotes encontram uma maneira de dar casas novas aos seus brinquedos antigos.","air_date":"2022-02-11","runtime":23,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":10},"8":{"name":"Cães bombeiros / Payground Expresso","overview":"Pedro inspira a cidade a agradecer aos cães de bombeiros de Muttgomery. Puck traz a diversão para um amigo cujo bairro não tem playground.","air_date":"2022-02-11","runtime":23,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":10},"9":{"name":"Muttgomery feliz!","overview":"Quando uma forte tempestade de neve coloca em risco o festival anual de fim de ano, os filhotes encontram maneiras únicas de comemorar com todos os cães presos em casa da cidade.","air_date":"2022-02-11","runtime":23,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":10}}},"2":{"name":"Temporada 2","poster_path":"https://image.tmdb.org/t/p/original/gAy540Q3e7N55u5YV87MYW34azt.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/gAy540Q3e7N55u5YV87MYW34azt.jpg","air_date":"2023-02-23","episode_count":9,"overview":"N/A","vote_average":10,"episodes":{"1":{"name":"Sacolas cão / Pega","overview":"A missão de limpeza de Poppy inspira mudanças no bairro. Pedro sai para recuperar uma bola amada de um telhado próximo.","air_date":"2023-02-23","runtime":23,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":10},"2":{"name":"Laços bow uau / Problemas de soninho","overview":"Pippa ajuda Rosie a encontrar uma nova maneira de vestir seus laços. Enquanto Puck se esforça para adormecer, Pretzel o convida para uma jornada relaxante.","air_date":"2023-02-23","runtime":23,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":10},"3":{"name":"Caminhão gigante / Filhotes voando","overview":"Puck encoraja Curly a enfrentar seu medo do caminhão de lixo. Paxton trabalha em uma surpresa especial para vovó Doxie.","air_date":"2023-02-23","runtime":23,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":10},"4":{"name":"Ficção de filhotes / Noite no cãospital","overview":"Poppy lidera um passeio de dia chuvoso para a Biblioteca Muttgomery. Depois que Sammy machuca sua pata, os filhotes o animam com uma aventura de faz de conta.","air_date":"2023-02-23","runtime":23,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":10},"5":{"name":"Novos truques / Cães afora","overview":"Vovó Doxie e seus vizinhos ajudam Pedro a dominar um truque de scooter. Greta reúne a turma para uma caminhada até o pico nevado do Monte Muttgomery.","air_date":"2023-02-23","runtime":23,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":10},"6":{"name":"Procuradores peludos / Amigos de uivo","overview":"Quando o hamster de Dill e Dalila desaparece, os filhotes entram em ação. Pedro descobre uma maneira única de conhecer cães que querem brincar.","air_date":"2023-02-23","runtime":23,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":10},"7":{"name":"Fortaleza filhote / Parque árvore","overview":"Paxton procura um lugar para trabalhar em sua arte. Poppy vê potencial em uma árvore caída perto do parque.","air_date":"2023-02-23","runtime":23,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":10},"8":{"name":"Grupo do almoço / Hora da mamãe","overview":"Russell e o seu vovô inspiram um plano para ajudar filhotes famintos. Depois que Greta perde a diversão em família, Poppy tenta recriar a magia.","air_date":"2023-02-23","runtime":23,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":10},"9":{"name":"Encontro de filhotes / Feliz cão-niversário","overview":"A Srta. Clawtez apresenta os filhotes a um novo amigo. Os filhotes comemoram o aniversário deles e retribuem à comunidade.","air_date":"2023-02-23","runtime":23,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":10}}}}},
